import React, { useState, useEffect } from 'react';
import axios from 'axios';

function App() {
    const [teachers, setTeachers] = useState([]);

    useEffect(() => {
        const fetchData = async () => {
            const result = await axios.get('http://localhost:3001/'); // Replace with your own API endpoint
            setTeachers(result.data);
        };
        fetchData();
    }, []);

    return (
        <div>
            <h1>Teachers</h1>
            <table>
                <thead>
                    <tr>
                        <th>Name</th>
                        <th>Phone</th>
                        <th>Subject</th>
                        <th>Attendance</th>
                    </tr>
                </thead>
                <tbody>
                    {teachers.map((teacher) => (
                        <tr key={teacher._id}>
                            <td>{teacher.Name}</td>
                            <td>{teacher.PhoneNo}</td>
                            <td>{teacher.Subject}</td>
                            <td>{teacher.Attendance}</td>
                        </tr>
                    ))}
                </tbody>
            </table>
        </div>
    );
}

export default App;
